import './App.scss';
import {BrowserRouter, Route, Switch} from "react-router-dom";
import {routes} from "./routes/routes";
import Sidebar from "./components/Sidebar";

function App() {
  return (
    <BrowserRouter>
      <div className="sidebar">
        <Sidebar />
      </div>
      <div className="content">
        <Switch>
          {routes.map((route) => (
            <Route
              component={route.component}
              path={route.path}
              exact={route.exact}
            />
          ))}
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
